export default function Image({icon}) {
  return (
    <img
      className="Image"
      src={icon.url}
      alt={icon.name}
      style={{
        width: icon.width,
        height: icon.height,
        position: 'absolute',
        top: 100,
        left: 1000
      }}
    />
  );
}
